import "./Content.css";

export default function Content({ searchResult }) {
  // console.log(data);

  return (
    <div className="content-box">
      {searchResult.map((el) => (
        <Card animeData={el} key={el.mal_id} />
      ))}
    </div>
  );
}

function Card({ animeData }) {
  console.log(animeData);
  console.log(animeData?.mal_id);

  return (
    <div className="card-content">
      <div className="card-img-box">
        <img
          className="card-img"
          // src={animeData?.images?.jpg?.large_image_url}
          src={animeData?.images?.webp?.large_image_url}
          // src={"https://cdn.myanimelist.net/images/anime/1171/109222l.jpg"}
          alt="k"
        ></img>
      </div>
      <h2 className="card-title">{animeData?.title_english}</h2>
    </div>
  );
}
